var subMileTag = [30]byte{34, 108, 97, 116, 101, 115, 116, 83, 111, 108, 105, 100, 83, 117, 98, 116, 97, 110, 103, 108, 101, 77, 105, 108, 101, 115, 116, 111, 110, 101}
var subMileIndexTag = [34]byte{108, 97, 116, 101, 115, 116, 83, 111, 108, 105, 100, 83, 117, 98, 116, 97, 110, 103, 108, 101, 77, 105, 108, 101, 115, 116, 111, 110, 101, 73, 110, 100, 101, 120}

const commaAsciiVal = 44

func reduceToLatestSolidSubtangleData(data []byte) ([]byte, error) {
	indexOfSubtangleHashKey := bytes.Index(data, subMileTag[:])
	if indexOfSubtangleHashKey == -1 {
		return nil, api.ErrNoLatestSolidSubtangleInfo
	}
	indexOfSubtangleIndexKey := bytes.Index(data, subMileIndexTag[:])
	if indexOfSubtangleIndexKey == -1 {
		return nil, api.ErrNoLatestSolidSubtangleInfo
	}
	commaIndex := bytes.Index(data[indexOfSubtangleIndexKey:], []byte{commaAsciiVal})
	if commaIndex == -1 {
		return nil, api.ErrNoLatestSolidSubtangleInfo
	}
	if indexOfSubtangleIndexKey+commaIndex > len(data) {
		return nil, api.ErrNoLatestSolidSubtangleInfo
	}
	part := data[indexOfSubtangleHashKey : indexOfSubtangleIndexKey+commaIndex]
	// add opening/closing bracket
	part = append([]byte{123}, part...)
	part = append(part, 125)
	return part, nil
}

const closingCurlyBraceAscii = 125

var durationKey = [11]byte{34, 100, 117, 114, 97, 116, 105, 111, 110, 34, 58}

// removes the duration value from the response
// as multiple nodes will always return a different one
func removeDurationField(data []byte) []byte {
	indexOfDurationField := bytes.LastIndex(data, durationKey[:])
	if indexOfDurationField == -1 {
		return data
	}
	curlyBraceIndex := bytes.Index(data[indexOfDurationField:], []byte{closingCurlyBraceAscii})
	return append(data[:indexOfDurationField-1], data[indexOfDurationField+curlyBraceIndex:]...)
}

func extractSubTangleMilestoneHash(data []byte) (string, error) {
	fmt.Println([]byte(":"))
	firstColonIndex := bytes.Index(data, []byte(":"))
	if firstColonIndex == -1 {
		return "", errors.Wrap(api.ErrNoLatestSolidSubtangleInfo, "unable to find hash")
	}
	leadingQuoteIndex := bytes.Index(data[firstColonIndex+1:], []byte("\""))
	if leadingQuoteIndex == -1 {
		return "", errors.Wrap(api.ErrNoLatestSolidSubtangleInfo, "unable to find leading quote in hash search")
	}
	leadingQuoteIndex = firstColonIndex + 1 + leadingQuoteIndex
	endingQuoteIndex := bytes.Index(data[leadingQuoteIndex+1:], []byte("\""))
	if endingQuoteIndex == -1 {
		return "", errors.Wrap(api.ErrNoLatestSolidSubtangleInfo, "unable to find ending quote in hash search")
	}
	endingQuoteIndex = leadingQuoteIndex + 1 + endingQuoteIndex
	return string(data[leadingQuoteIndex+1 : endingQuoteIndex]), nil
}

func extractSubTangleMilestoneIndex(data []byte) (uint64, error) {
	lastColonIndex := bytes.LastIndex(data, []byte(":"))
	if lastColonIndex == -1 {
		return 0, errors.Wrap(api.ErrNoLatestSolidSubtangleInfo, "unable to find index")
	}
	index := data[lastColonIndex+1 : len(data)-1]
	return strconv.ParseUint(string(index), 10, 64)
}

func parseGetNodeInfo() {
	var err error
	data := removeDurationField(getNodeInfoRaw)
	data, err = reduceToLatestSolidSubtangleData(data)
	must(err)

	hash, err := extractSubTangleMilestoneHash(data)
	must(err)
	fmt.Println(hash)

	index, err := extractSubTangleMilestoneIndex(data)
	must(err)
	fmt.Println(index)
}

func bla() {
	primaryNode := "https://trinity.iota-tangle.io:14265"
	defaultWereAddressesSpentFrom := true
	iotaAPI, err := api.ComposeAPI(api.QuorumHTTPClientSettings{
		// primary node which is used for IRI calls which don't make
		// sense to send to multiple nodes, such as getTransactionsToApprove() etc.
		PrimaryNode: &primaryNode,
		Nodes: []string{
			"https://peanut.iotasalad.org:14265",
			"https://potato.iotasalad.org:14265",
			"https://wallet1.iota.town:443",
			"https://nutzdoch.einfachiota.de",
			"https://pool.trytes.eu",
			"https://turnip.iotasalad.org:14265",
		},
		Client: &http.Client{Timeout: time.Duration(5) * time.Second},
		// needed voting percentage for satisfying the quorum
		Threshold: 0.9,
		// percentage of nodes which can fail to give a response
		NoResponseTolerance: 0.20,
		// set commands which are forced to be done in quorum
		ForceQuorumSend: map[api.IRICommand]struct{}{
			// execute broadcast transaction on each node, instead of just primary
			api.BroadcastTransactionsCmd: {},
		},
		// defaults
		Defaults: &api.QuorumDefaults{
			// if the quorum didn't come to a conclusion, then 'true' is returned in this case
			WereAddressesSpentFrom: &defaultWereAddressesSpentFrom,
		},
	}, api.NewQuorumHTTPClient)
	must(err)

	// get the node info from the primary node
	nodeInfo, err := iotaAPI.GetNodeInfo()
	must(err)
	fmt.Println("node info via primary node:", nodeInfo.LatestMilestoneIndex)

	// get the latest solid subtangle milestone via quorum
	resp, err := iotaAPI.GetLatestSolidSubtangleMilestone()
	must(err)

	fmt.Println("")

	// query the actual balance of the given address by using the solid subtangle
	// milestone which was queried via quorum.
	ss := time.Now()
	balance, err := iotaAPI.GetBalances(addrsToQuery, 100, resp.LatestSolidSubtangleMilestone)
	must(err)
	fmt.Printf("balance fetched via quorum [%v]: %d\n", time.Now().Sub(ss), balance.Balances[0])
}
